def run(value_list):
    """
    Calculates the 2019 average defined contribution schemes from the given value list.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a financial value.

    Returns:
        A tuple containing the average value and its scale.
    """
    defined_contribution_schemes_2019 = [
        d['number_value'] for d in value_list if d['category'] == 'Defined contribution schemes' and d['header1'] == '2019 € million'
    ]
    if defined_contribution_schemes_2019:
        average = sum(defined_contribution_schemes_2019) / len(defined_contribution_schemes_2019)
        return (round(average, 2), 'million')
    else:
        return (0.0, '')

