def run(value_list):
    """
    Calculates the average total current tax expense for 2017 and 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average total current tax expense.
    """
    total_2017 = 0
    count_2017 = 0
    total_2018 = 0
    count_2018 = 0

    for item in value_list:
        if item['header3'] == '2017':
            total_2017 += item['number_value']
            count_2017 += 1
        elif item['header3'] == '2018':
            total_2018 += item['number_value']
            count_2018 += 1

    if count_2017 > 0 and count_2018 > 0:
        average = (total_2017 + total_2018) / (count_2017 + count_2018)
        return (round(average, 2), 'million')
    elif count_2017 > 0:
        return (round(total_2017 / count_2017, 2), 'million')
    elif count_2018 > 0:
        return (round(total_2018 / count_2018, 2), 'million')
    else:
        return (0.00, '')

