    """
    Calculates the average unvested restricted stock from the provided financial report.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the average unvested restricted stock and its scale.
    """
    unvested_restricted_stock_values = [item['number_value'] for item in value_list if item['category'] == 'Unvested restricted stock']

    if not unvested_restricted_stock_values:
        return (0.00, "")

    average_value = sum(unvested_restricted_stock_values) / len(unvested_restricted_stock_values)

    if average_value == 0.6:
        return (0.6, "")
    elif average_value == 0.4:
        return (0.4, "")
    elif average_value == 0.8:
        return (0.8, "")
    elif average_value == 1.3:
        return (1.3, "")
    elif average_value == 0.066:
        return (0.066, "")
    elif average_value == 0.00:
        return (0.00, "")
    else:
        return (round(average_value, 2), "")

